import React, {Component} from 'react';
import "./index.css"
import PubSub from 'pubsub-js'
import axios from 'axios'

export default class Search extends Component {
    handleSearchValueInput =()=>{
        this.setState("searchValue")
    }
    handleSearchValue =()=>{
        console.log(this.state.value)
    }

    render() {
        return (
            <div>
                <form className={"search"}>
                    <input   onChange={this.handleSearchValueInput} type={"text"} className={"SearchInput"} placeholder={"Search your movie!"}/>
                    <input  onClick={this.handleSearchValue} type={"submit"} className={"SearchButton"} value={"Search"}/>
                </form>
            </div>
        );
    }
}
